window.bookSummaryJSON = "<p>This guide, both a companion to Dr. Robert Glover's <i>No More Mr. Nice Guy</i> and a stand-alone manual, takes the listener on a step-by-step journey of masculine self-discovery. It provides a practical and emotional understanding of the problems that many nice guys face, and it lays out a series of easy-to-follow exercises for overcoming those issues. By the end of the journey, you will have the tools to help you pursue your goals with passion and courage, develop more rewarding relationships, enhance your sex life, embrace your masculinity, and ultimately, live a fuller, richer, happier life.</p> <p>Utilizing the fundamental ideas of <i>No More Mr. Nice Guy</i>, this guide adds additional insight and a chapter-by-chapter series of structured exercises to help you move from frustrated nice guy to powerful and confident integrated male. As you take your own personal hero's journey, you will be learning skills essential for creating a better life. </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
